import React, { Component } from 'react'
import HomePage from './HomePage';
import LoginForm from './LoginForm';
import MainPage from './MainPage';

export default class NavBar extends Component {
    render() {
        return (
            <div>
                <div class="ui menu">
                    <div class="header item">
                        Ro
                    </div>
                    <a class="item">
                        About Us
                    </a>
                    <a class="item">
                        Jobs
                    </a>
                    <a class="item">
                        Locations
                    </a>
                </div>

            </div>
        )
    }
}
